	def crypt_to_message(self,crypt):
		prefixes1=['0','1','5','8','9']
		prefixes2=['3','4','6','7','2']

		lenght=0
		short_memory=[]
		indentificator=""
		if crypt[0]=="+":
			valid=True
		else:
			valid=False

		if valid:	
			stage=0
			parts=0	
			for symbol in range(1,len(crypt)):
				if crypt[symbol]=="-" and parts==0:
					parts=1
				if not parts:
					indentificator+=(crypt[symbol])




				if crypt[symbol]=="-":


					if crypt[symbol+1] in prefixes1:
						if  int(crypt[symbol+1])%2:
							short_memory.append(int(crypt[symbol+2]))
						else:
							short_memory.append(int(crypt[symbol+4]))	

					elif crypt[symbol+1] in prefixes2:
						if  int(crypt[symbol+1])%2:
							short_memory.append(int(crypt[symbol+2:symbol+4]))
						else:	
							short_memory.append(int(crypt[symbol+3:symbol+5]))
		
				if crypt[symbol]=="=":
					break

		indentificator=int(indentificator)
		string=""
		for number in short_memory:
			string+=self.series[indentificator][number]

		return string	
		 

